import React from 'react';
import { FormControl, FormLabel, RadioGroup } from '@mui/material';
function PokemonAdd({addPokemon}) {
   
    return (
        <FormControl>
        <FormLabel>Gender</FormLabel>
        <RadioGroup
          name="gender"
          value={formValues.gender}
          onChange={handleInputChange}
          row
        >
          <FormControlLabel
            key="male"
            value="male"
            control={<Radio size="small" />}
            label="Male"
          />
          <FormControlLabel
            key="female"
            value="female"
            control={<Radio size="small" />}
            label="Female"
          />
          <FormControlLabel
            key="other"
            value="other"
            control={<Radio size="small" />}
            label="Other"
          />
        </RadioGroup>
      </FormControl>
    )
}

export default PokemonAdd;
